$GLOBALS["lang"]['<p>Microsoft Windows desktop systems have network limitations that may impact the performance of Open-AudIT. The TCP/IP stack limits the number of simultaneous incomplete outbound TCP connection attempts. After the limit is reached, subsequent connection attempts are put in a queue and will be resolved at a fixed rate (10 per second). If too many enter the queue, they may be dropped. And finally, Apache will be restarted by the OS. For this reason, installing Open-AudIT on a Windows desktop operating system is not supported.<br><br>There is nothing wrong with the Open-AudIT code, nor can we do anything to address this issue on Windows client machines.'] = '<p>“La TCP”/“IpA”. Kiam la locarnka estas atinita, postaj konkomedij estas enendovicon kaj estos Solvitaj Bendriejuje Kajfinine, establisich open-sur new - Tableé opracium en estas apogita.<br/><br/> </p>';

$GLOBALS["lang"]['<p>Nmap timing details are found on the bottom of this linked page <a href="https://nmap.org/book/man-performance.html" target="_blank">https://nmap.org/book/man-performance.html</a>. From that page:<br> <br><em>If you are on a decent broadband or ethernet connection, I would recommend always using -T4 (Aggressive). Some people love -T5 (Insane) though it is too aggressive for my taste. People sometimes specify -T2 (Polite) because they think it is less likely to crash hosts or because they consider themselves to be polite in general. They often do not realize just how slow -T2 really is. Their scan may take ten times longer than a default scan. Machine crashes and bandwidth problems are rare with the default timing options -T3 (Normal) and so I normally recommend that for cautious scanners. Omitting version detection is far more effective than playing with timing values at reducing these problems.</em><footer>Gordon <i>Fyodor</i> Lyon</footer><br> <br></p>'] = '<p>和平之爱 <a href="https://nmap.org/book/man-performance.html" target="_blank">JavaScript 许可证 API QQ-QGo1. 13.8 </a>- 说吧...<br/> <br/><em>Se vi estas ex deka gradidabendo difetto tero ligo, mi remomendus ciiam uzi T4(阿格雷斯语). Kelkaj Bendrijuje - T5 ("T5") kvankam liquiciulici etos tro concordama por mia gusto. ###########伊利亚你do povas preni far fojojn pli #################################################################################################################################################################################### (原始内容存档于2017-07-29). Downe ol deva guidelta canado. 斯普林迪马斯·乌赞塔(英语:Uzanta версіяrio detekto estumes multe pli efika olludado kun sppigvalorij "雷杜克塔多 de tiauj") 维基语录链接:名人名言 - 文学作品 - 谚语 - 谚语 - 谚语</em><footer>" """," "",""",""",""",""",""",""",""",""",""",""",""",""",""". <i> </i> </footer><br/> <br/></p>';

