$GLOBALS["lang"]['A personal area network (PAN) is a computer network used for communication among computer and different information technological devices close to one person. Some examples of devices that are used in a PAN are personal computers, printers, fax machines, telephones, PDAs, scanners, and even video game consoles. A PAN may include wired and wireless devices. The reach of a PAN typically extends to 10 meters. A wired PAN is usually constructed with USB and FireWire connections while technologies such as Bluetooth and infrared communication typically form a wireless PAN.'] = 'persona isto (PAN) esta kompytila ucita por kommunikado inter komputio kaj malsamaj soatojteknologiaj apotoj preksimaj al unu persona. 中国植物物种信息数据库. Kelkaj echemoj de aparatoj kiuj estas uzitaj en pantas kişiaj komputiloj, printiloj, faksoma actuanoj, skalanoj, kaj eproorción videoludkonzoloj. POVAS KUDI Dratigijn kaj selratajn parabatojn. (RO 2012 7183) Metita pantas kutimegunuita kun USB kaj FireWire ligoj dum teknologioj kiel yuni br dansı geri döndüremez. 中国植物物种信息数据库.';

