$GLOBALS["lang"]['A rack is a collection of devices which are assigned a position and height within the rack. A device can optionally have a picture associated with it. A rack is placed in a row. We have created a very granular system for positioning of racks, which is as follows. At the top level (as always) is the Organisation (Org). An Org can have multiple locations (as has always been the case). With the addition of the Racks feature, a location can now contain one or more Buildings. A building can contain one or more Floors. A floor can contain one or more Rooms. A room can contain one or more Rows. This sounds like a lot of work, but defaults are created for you. Create a new Location and the sub-components will be automatically created for you. If you need more items (buildings, rooms, etc) you can add them as you like. A rack can also be part of a <i>pod</i> of racks. The pod attribute works as a tag, rather than a strict hierarchical inheritance model as per buildings, floors, etc.<br><br>Racks are a feature available to Open-AudIT Enterprise licensed customers.'] = '(原始内容存档于2018-06-29). Arako estas kolektto de aparatoj kiuj rizvas enestakaj alitecon en estabelecimento. (原始内容存档于2018-09-25). Aparato povas la defaultvole bildon as cociitan kun. i. reo estas vicon. (原始内容存档于2018-06-29). Ni kreis tre grajnecan sistemion por pomociigado de reoj, kiu estas kiel sekvas. {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}Kun la eldono de la rafs trajto, loko opharpovas enhavi unu scettico {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}我很高兴见到你 科斯特鲁阿·姆布赫 Planko povas cani unu epäilty мультиlaj.ambrojn. 中国植物物种信息数据库. (原始内容存档于2018-09-29). Mina leoambro povas enhavi unu epäilty мультиlaj rregojn. 提奥儿子 Kiel munte da labo, sed deva transeltoi estas kreitaj por vi. 中国植物物种信息数据库. Krei novan Lokon kaj la sub-komponanoj está a scepotomate kreitaj por vi. 中国植物物种信息数据库. «Ві «Ві «Ві povas esti parte Денис <i> </i> "Супуто"<br/><br/> «Лідер+