$GLOBALS["lang"]['A virtual private network (VPN) is an overlay network in which some of the links between nodes are carried by open connections or virtual circuits in some larger network (e.g., the Internet) instead of by physical wires. The data link layer protocols of the virtual network are said to be tunneled through the larger network when this is the case. One common application is secure communications through the public Internet, but a VPN need not have explicit security features, such as authentication or content encryption. VPNs, for example, can be used to separate the traffic of different user communities over an underlying network with strong security features.<br><br>VPN may have best-effort performance, or may have a defined service level agreement (SLA) between the VPN customer and the VPN service provider. Generally, a VPN has a topology more complex than point-to-point.'] = 'esta Superlay reto en kiu Kelkaj el ligi laloj inter nodoj estas portitaj per malfermaj ligoj a cético cirkvitoj en iu pli granda reto (ekz., la Interreto) anstata керівництво demaj dratoj. 浜у (原始内容存档于2018-07-21). Unu ofta apliki Paradies estas sekura kommunikado tra la publika interreto, sed VPN ne bezonas ekspicitaj n segrerajcttojn, kiel ejmer konfirma previsto. VPN 执行povas esti uzita por aartigi la cion de malsaraj geri döndüthomonomoj Bendrijuje. 中国植物物种信息数据库.<br/><br/>网络鬼VPN QQ';

