$GLOBALS["lang"]['Each IP is scanned with the discovery configured options (see Discovery Scan Options and Discovery - Community vs Professional vs Enterprise on the wiki). In general, Nmap will test for ports 22 (ssh), 135 (wmi), 62078 (iPhone) and UDP 161 (snmp). If 22, 135 or 161 respond the credential list is retrieved and each credential tested in turn. The first working credentials are used for further queries directly from the device. Note - if a device has previously been discovered and has working credentials, those credentials are tested first. Only if those fail are the other credentials then attempted.'] = ' "ar" ar "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar" "ar"\'"\'"\'""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""""';

