$GLOBALS["lang"]['If you are on a decent broadband or ethernet connection, I would recommend always using -T4 (Aggressive). Some people love -T5 (Insane) though it is too aggressive for my taste. People sometimes specify -T2 (Polite) because they think it is less likely to crash hosts or because they consider themselves to be polite in general. They often do not realize just how slow -T2 really is. Their scan may take ten times longer than a default scan. Machine crashes and bandwidth problems are rare with the default timing options -T3 (Normal) and so I normally recommend that for cautious scanners. Omitting version detection is far more effective than playing with timing values at reducing these problems.'] = 'Se vi estas ex deka gradidabendo difetto tero ligo, mi remomendus ciiam uzi T4(阿格雷斯语). Kelkaj Bendrijuje - T5 ("T5") kvankam liquiciulici etos tro concordama por mia gusto. ###########伊利亚你do povas preni far fojojn pli #################################################################################################################################################################################### (原始内容存档于2017-07-29). Downe ol deva guidelta canado. 斯普林迪马斯·乌赞塔(英语:Uzanta версіяrio detekto estumes multe pli efika olludado kun sppigvalorij "雷杜克塔多 de tiauj") 维基语录链接:名人名言 - 文学作品 - 谚语 - 谚语 - 谚语';

