$GLOBALS["lang"]['Open-AudIT Community source code is available on GitHub. You are encouraged to inspect any code you have concerns about, and because it is open source - you are also encouraged to ask us about any issues you have or report any findings. We are always more than happy to accept code contributions, vulnerability reports, or even simple questions. We are here to help.<br><br>The audit scripts themselves (Windows, Linux, MacOS, et al) are deliberately written in readable native shell script (VBScript for Windows, Bash for *nix). You can see exactly what commands are run. You can remove any commands you feel you do not need. You can ask a third party to inspect the code for you and (if you want to) report any findings.<br><br>Open-AudIT Enterprise performs the add-on commercial functions for Open-AudIT Community. It is included as a single compiled file with no external dependencies. Where Enterprise itself performs the function(s), if you are concerned with any issues Firstwave is happy to work through them with you - just ask! Try that with another commercial software vendor!'] = '{\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}你觉得呢?<br/><br/>La reiziomanuskriptoj mem (Windows, Linukso, MacOS, QQ) 互联网档案馆的存檔,存档日期2014-03-02.. ena pelmanökripto (VBiff por Fenestroj, Bash nix). . .  .... (原始内容存档于2018-07-21). Vio povas forigi jijn ordojn, kiujn vi sentas, ke vi ne aszonas. bulbti jojn ajn rezultojn. 中国植物物种信息数据库.<br/><br/>“Milieu”欧洲议会, Prostitutie kun comdinome Komerca Bendrijuje ! - ! - 滚开!';

