$GLOBALS["lang"]['Open-AudIT can be run on your server in your data center. It does not need access to the internet at all. Even the installation on Linux where we use the distribution package manager for our prerequisites can be negated by you using an in-house and security team-approved package repository.<br><br>Open-AudIT does not store any of your data in the cloud. Even licensing information can be provided without having to access the internet from the Open-AudIT server.<br><br>Sure, it is easier to allow it to access the internet to download packages (including security fixes) for your distribution, but that is up to you and your security policies. Open-AudIT does not need the internet.'] = '(原始内容存档于2018-07-25). Ava-Aud.i povas esti prizorgita real linapáca hadlon en datumcentro aracılılılıl. {\fn黑体\fs20\shad2\2aH82\3aH20\4aH33\fscx95\3cH592001\be1}你觉得呢?<br/><br/>Eruga endinciadinformoj povas ve distonigitaj sen aliri la interreton de la open-Portugu-servilo. 2005 ==========================================================================================================================================================================================================<br/><br/>i aliri la Interreton por el apretuti paka.ojn (inkluzive de sekureco Fixas) Daligtımio esto estas.is vi kaj ile segreco -.';

