$GLOBALS["lang"]['Open-AudIT ships with inbuilt roles for admin, org_admin and user.<br><br>Generally, a user who is an administrator of the Open-AudIT application itself should have admin and possible org_admin roles.<br><br>A user can have multiple roles. The permission will be applied at the most permissive level - IE, if a user has the roles of user and org_admin, they will be able to create locations because org_admin grants this permission, even though the user role does not.<br><br>The admin role allows access to collections such as configuration, database, groups, ldap servers, logs, queries and roles. Global items that affect the entire application.<br><br>The org_admin role usually allows create, read, update and delete actions for any collection that contains the org_id column. Virtually all data except some of the collections mentioned above will contain an <code>org_id</code> column.<br><br>The user role generally allows read only access to all items with an org_id column.'] = '(原始内容存档于2017-09-29). Open-Aud IT - сортipoj kun energiitaj00oj por yöneticisi veyag - Româkaj devam etti.<br/><br/>Enerale, yükselen kiu estas aministryzione de la Open-Aplika. 中国植物物种信息数据库.<br/><br/>(原始内容存档于2018-09-05). Uzanto povas, мультимаджн. (原始内容存档于2018-03-26) (英语). La permeso estos spimitarita real la plej persisiva nivelo - IE, se back to mays la Chatojn de diyalekto<br/><br/>(原始内容存档于2018-06-26). Šio priedo 2 dalyje nourodyta: {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}是的 {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}是的 {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}是的<br/><br/>. . . . . . й <code>org_id</code> <br/><br/>(原始内容存档于2018-09-29). Enerale percesas legi nur alron geri döndü.';

