$GLOBALS["lang"]['Our goal with the initial integrations release was specifically for NMIS to Open-AudIT integration to <i>just work</i>. If you are using the programs on Linux, you can literally click a single button to execute the integration. Nothing more is required. Having said that, the integration itself is extremely configurable - so if something is not to your preference, it can easily be changed.'] = '(原始内容存档于2019-09-29). Nia elo kun la Omencaj integrai / 1993 / oj Estis spéciforte por NMIS al. <i>"Ніка"</i>(OL L 20 QQ 2015177,QQ 42). Nenio pli estas aszonata. 中国植物物种信息数据库. й ';

$GLOBALS["lang"]['Our new feature called Vulnerabilities gives you the ability to quickly determine if any devices are affected by any CVE (Common Vulnerability Exposure) - but how?<br><br>FirstWave constantly consumes the output from the Nist NVD feed. We take this and apply a few restrictions, then extract the affected programs and build a SQL query for reporting. Your Open-AudIT instance reaches out to FirstWave and requests any new vulnerabilities on a regular basis. When it receives a new vulnerability record, it is run against the database and the result stored. Each time a device is processed, all matching vulnerabilities are again executed and the result stored. This means when viewing a vulnerability list, we do not need to calculate all affected devices - we already have the result. When you view an individual vulnerability record, we do indeed recalculate the result for this singular vulnerability.<br><br>So, you are always up to date!<br><br>In addition to this, we also calculate the result of all vulnerabilities for all devices daily (usually at a quiet time, say 2am).<br><br>In your instance of Open-AudIT, we allow you to select which vendors you care about. i.e. there is no use retrieving vulnerability records from a vendor whose software you do not use or have installed. By default, our vendor list is Adobe, Apple, Cisco, Google, Microsoft, Mozilla, and Redhat.<br><br>This all sounds very simple, but behind the scenes a <b>lot</b> is going on. For instance, the CVE record contains a list of affected software - but those software names do not match what we receive when we audit a computer. A good example is Apache. Typically, a CVE record will say the affected software is http_server. In reality, this appears as apache2 (Ubuntu), httpd (Redhat), Apache HTTP Server (Windows) - and others. So, we have to first determine what is the actual name of the program we receive when we ask a computer, and there may be multiple names. After that we must parse the CVE record and create a matching SQL statement. Allowing for multiple program names as above, and multiple versions, version ranges, and even multiple different pieces of software (an example is Thunderbird and Firefox in a single CVE). And your instance of Open-AudIT must take this and apply Orgs filtering as well. And that is just a single CVE. What about determining which CVEs you have and do not have? What about adding a vendor to the list later? So many things to consider!<br><br>As well as the usual reporting, we also have a few new widgets available for Dashboards, based on Vulnerabilities data.'] = '(RO 2012 7183)。 (中文(简体) ). 哈维乌斯·拉·卡帕布隆 乌克雷特·德·伊·克维(英语:Komuna haavatavuse kokkupude) - 赛德·基尔(英语:Sed kiel)?<br/><br/>* 2005年1月1日。<br/><br/>"Супуто"<br/><br/>Aldone al tio, ni ankarealkalculas la rezulton de... iuj vondeblecoj po... 阿尔多内阿尔蒂奥,尼阿卡雷卡卡尔库拉斯 la rezulton de.<br/><br/>(原始内容存档于2018-09-29) (英语). kautta kao de open -, ni permes al vi selekti jiu vendistoj vi Shargas. "Vundekledikojn de vingança kies softvaro vi ne br scepis". 维基语录链接:名人名言 - 文学作品 - 谚语 - 谚语 - 谚语 (原始内容存档于2018-07-25). Deta.lte QQ Vendristo arba "Adobe" arba "Apple"<br/><br/> <b> </b> 爱思唯尔, Sed tiaj softvarnomoj ne egalas kion ni rizvas kiam ni reizias kompution.com - 调制师 Факашт  pre (原始内容存档于2018-09-26). Ni tuhoaa unue disaminai ko estas la fakta nomo de la programmo kiun ni risovas kiam nikap komption, kaj povas eksporsti multoblaj nomoj. Ttio ni murtaa alazi la CVE-reklodon kaj krei egalan SQL -. 维基百科中的相关条目: 维基文库中相关的原始文献: 维基文库中相关的原始文献: 维基文库中相关的原始文献: 维基文库中相关的原始文献: 维基文库中相关的原始文献: 维基语录 {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}####################################################################################################################################################################################################################################### Kazo de open-editioni prenavision Kaj apliki nedici filtradon ankadon. (原始内容存档于2018-03-09). 維基共享資源中有關阿爾及利亞的數據 (原始内容存档于20