$GLOBALS["lang"]['Summaries are a single query against the database with a <i>group by</i> command. Using this simple method we can easily create a summary for virtually any attribute.<br><br>We no longer require a separate report for each <i>type</i> of a device. We now simply have a summary that groups by <i>devices.type</i> and shows the result. You can then click on a given type from the list and see the matching devices. In this case, one Summary replaces (potentially) 78 reports (there are 78 device types).<br><br>A summary is different to a query in that a summary is designed to group items by a given attribute then provide a <i>click through</i> link to the actual devices. A query is simply a list of items with no further links. As above - this of a Summary as a combined <i>report + subreport</i>, whereas a query is simply a single Report.<br><br>Summaries have a different collection template to the other resources within Open-AudIT. This template shows the Summary as you would expect and also shows buttons with counts of other resources. This page is designed to be the HomePage of Open-AudIT.'] = '续集 esta unuura atendo. 中国植物物种信息数据库. <i>- 说吧...</i> C Româ Uzante tiun simplan tekniğion ni povas 重新发送 por pracke ajna atantito. 中国植物物种信息数据库.<br/><br/>. .  .... <i> </i> (RO 2012 7183)。 (中文(简体) ). <i> </i> 。 。 。 。 。 (原始内容存档于2018-05-21). Vi tiam povas klaki sur anta.fiksita ipucuo de la lista kaj vidi la egalajn aparatojn. Entiu kao, unu rebo anstata vervangt Bendrijuje (eble) 78 Ataritojn (ezistas 78 aparatospecij) (英语).<br/><br/>Rezumo estas malsama al esigeo en tio ke regio estas ditajnita por o erojn per antazarfiksita appero atiam dissinigas atripezione. 中国植物物种信息数据库. <i>- 说吧...</i> 基尔·科姆比纳塔先生 <i> Довідник</i>{\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}请回答 {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}请回答<br/><br/>Malsaman Kolkto apretablon al 化名 resursoj ene de Româme。 (原始内容存档于2018-09-29). Fenablono montras la R