$GLOBALS["lang"]['The collector is essentially a full install of Open-AudIT in <i>collector</i> mode. The collector is designed to run discovery upon the network it is situated in. It is not restricted to only that network, but ideally it would essentially be one collector per subnet where required. The collector is driven on a schedule by the server and runs discovery upon the network as specified.<br>When in Stand Alone mode the Collector acts as an independant server, simply forwarding all devices found to the main server.<br><br>Once installed and setup, control of the Collector is performed on the Server (not in Stand Alone mode).<br><br>The only required network ports between the collector and server are 80 or 443 (TCP connection established from the Collector to the Server). The Open-AudIT database is not (and cannot be) shared between these installs.<br><br>By default the collector (not in Stand Alone mode) will request from the server any discovery tasks every 5 minutes (you can configure this on the server for new Collectors using the configuration item collector_check_minutes) therefor any discovery tasks for the collector should be scheduled for 0, 5, 10, 15, etc minutes.'] = '(原始内容存档于2019-09-21) (英语). La kolektanto estas esence pena exouttaoo de open - modificatie <i> </i> {\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}我就是这个意思 科利肯托·莫维塔·霍拉罗·奥帕德·拉·哈洛·卡伊·普里佐加斯·埃尔特罗瓦<br/>Kiam en la Sola * la kolektano funkcias kiel endelica gömülülülio, seplicicemente artındidi 互联网档案馆的存檔,存档日期2013-12-21. <br/><br/>"Свартеник"<br/><br/>La uraj postulataj sendostaciaj, la kolektano kejlo estas 80 kaptlus 443 (TC- ligo esta lita de la kolektanto εis la Servilo). (Kaj LR povas esti) Distita režisier (英语).<br/><br/>. . . . . . . .';

