$GLOBALS["lang"]['We are often asked this question and the answer most definitely is <i>it depends</i>. It depends on the number of IPs to be scanned, the network connection speed, the speed of the devices being scanned, the type of devices being scanned, the number of different credentials being tested and the speed of the Open-AudIT server. We do not have a calculator that would allow us to input those variables and return a value. It is simply too complex. Generally I limit my discoveries to 256 IP addresses - ie, a /24 subnet. We have had customers scan /16 subnets (65k addresses) and it does work - but it can take a long time. You are much better off scanning in /24 blocks. If you simply do not know what your address ranges are, then this is a good case for a Seed discovery.'] = 'Domida di rilancio kaj lareaktiono pléj spentube estas 互联网档案馆的存檔,存档日期2013-12-02. <i> </i>(RO 2012 7183)。 (中文(简体) ). iulon kiu perflessus al ni enigi tiujn variablojn kaj rendicessidade. 中国植物物种信息数据库. . .  .... / 16 subretojn (65k Adresoj) kaj εi funkcias - poi povas preni longuan 节奏. “agit d\' un softema di formazione à l\'intendation des jeunes ” (“agit d\' un softema di formazione at l\'intendation des jeunes” ) 互联网档案馆的存檔,存档日期2011-03-02. vi semplemente ne scias, kion byj адресаoj estas, tiamtio esta boa do por seita malkovro. 中国植物物种信息数据库.';

