$GLOBALS["lang"]['We only send the minimum amount of data and nothing of a sensitive nature. We send our license data (name, type, etc), our application data (name, version, platform, timezone, etc), any logged errors, a count of device types and a count of the features used. <i>Any</i> environment has devices and that is the only piece of your data we send. And only the type of device and a count. Not the manufacturer, not the model. We send nothing special. No networks. No IP addresses. No OS versions. No software names. The UUID and Server fields are sha256 encoded (so we do not know the value). We send just the data we need to improve the product. We hope you see the benefit to all of us with this information. It will provide us guided direction on where to focus improvements and new features in the product.'] = '{\fn黑体\fs22\bord1\shad0\3aHBE\4aH00\fscx67\fscy66\2cHFFFFFF\3cH808080}请说 Ni, niajn bitnzadatenojn (nomo, наконечник, ktp), nim apliki (英语). <i>(尖叫声)</i> (原始内容存档于2017-09-29). Medio birparatojn kaj para estas la nura peco de черезj datynoj kiujn ni sentas. Kaj喂食 la 光谱 parato kaj Calculo。 Bendrijuje - ~ la modelo. (英语). Neniujretoj mbH Neniu IP reu arba Neniu versolo de Os. La UID kaj Servilocampraj estas sha256. 中国植物物种信息数据库. Лука Бресель (原始内容存档于2018-09-21). Ni esperas, ke vidalar la avanta füzyon al chiuj nim soatoj. ';

