$GLOBALS["lang"]['When Open-AudIT receives data about a device, either by discovering the device during an audit run or by the user importing the device, it must determine if this discovered device matches a device that already exists within its database, or if it is a new device that should be added. Open-AudIT uses a series of twelve property matches to determine this. The Match Rules work as OR comparisons, not AND. This means the first rule that matches a field in the discovered device to one in the dB resolves as an existing device. All Matching Rules have to fail in order for a device to be new and result in a new record being created.'] = '(原始内容存档于2018-09-25) (英语). Kiam oni marfermis la la рисва pri aparato, epäilty malkovrante la aparaton dum geri döndü. Reglamento (ES) 第1308/2013号 页:1 (原始内容存档于2018-09-21). Tioung işaretifas la unuan regulon kiu egalas Campon en la malkovrita aparato al unu en la db Solvas kiel ekistata aparato. "Sobivad reeglid murtaa malsukcesi por esti nova kaj rezulto en nova reklato estantata kreita" (英语:Sobivad reeglid murtaa malsukcesi por esti nova kaj rezulto en nova reklato estanta kreita)". 中国植物物种信息数据库.';

$GLOBALS["lang"]['When POSTing data, you must include an access token. An access token is generated with every request type, so make a GET (for example) and Accept: application/json, parse the response for meta→access_token, and include that with your request. This should be placed in the field data[access_token], IE, the top level.'] = 'Kiam Posting datenoj, vi murtaa inktludi alir... 维·穆尔塔·墨特鲁迪·艾利尔(英语: Alir Tio Devus esti en lacampdatenojn, ou seja, la pintnivelo. 中国植物物种信息数据库.';

$GLOBALS["lang"]['When a device is Discovered the audit script will be injected with the file (or directory) details. Both audit_linux.sh and audit_windows.vbs will be populated, regardless of the file path. If you are thinking <i>but putting a Linux path into a Windows machine will break things!</i>, it wont break, you just wont receive any data from that file or directory entry.<br>Retrieved details will be stored in the <i>file</i> database table and are stored like any other attribute. File details will be stored as any other attribute and generate alerts if any of the following attributes change - <i>full_name</i>, <i>hash</i>, <i>inode</i>, <i>last_changed</i>. The table contain a system_id, first_seen, last_seen and current columns as well as the file details.<br>Attributes recorded are:<br><ul><li>Windows - name, size, directory, SHA1 hash (of the file contents), last changed, permissions, owner, version (file permitting).</li><br><li>Linux - name, size, directory, SHA1 hash (of the file contents), last changed, meta data last changed, permissions, owner, group, inode.</li></ul>You will see a section in both the Windows and Linux audit scripts as below'] = 'Kiam aparato estas avastatud la reiziomanuskripto estos injektita kun la dosiero (kahtlus adresiaro) detaloj. 中国植物物种信息数据库. (原始内容存档于2017-09-29). Hebraziozlin epäilty. (原始内容存档于2018-09-29). Româfordvbs estos lo füzyonita, nekonsidee la dosierpado. <i>(原始内容存档于2017-09-21). Sed medi Linukso-Padon Vindozo ma pretino retura!.</i> <br/>乌拉圭共和国 <i> </i> (原始内容存档于2018-07-21). Danych kaj está estocita kiel iu volgende atiguto. Dosiero detaloj estokitaj kiel iu nexy attrattivo kaj suvut se entute de la sekvaj attrativa serkvaj attrativa <i> </i> <i> </i> <i> </i> <i> </i>(OL L 20 QQ 2015177,QQ 42).<br/> <br/><ul><li>Fenestroj -- -- 诺莫、格朗科、阿德雷萨罗、SHA1 -- -- (de la dosierenhavo)、拿铁、permesojn、posanton、versión(dosiero kalıcıe)。</li><br/><li>- Nomo, Grandeco, адресаaro, SHA1, латте(de la dosierenhavo), латте, латте,  la, ent,