$GLOBALS["lang"]['When auditing a Linux device via SSH, some Linux distributions do not allow sudo commands to be passed without a TTY (which we are doing). To completely audit one of these linux distributions it is best to supply the root user credentials. If no root is supplied and sudo without a TTY is not possible, the audit script will be run but will not contain the amount of data as would otherwise. Subsequent audits using root (or run locally using sudo) will therefore provide extra details about the system and generate several <i>changes</i>.'] = 'Dum revisado de Linukse-SSH, Bendrijje - "Linukse - ne permes al 115 kommundoj esti pasitaj sen TY (kiu ni faras)"(英语:kiu ni faras). L"的topluk de l"energie nucléaire dans le gizliği de l" iyi的"实用" en en en iyi的"实用" en en en nergie nucléaire. (原始内容存档于2018-09-29). Se nim reudas privizita kaj eksterlande sen tty ne estas ebla, la reiziomanuskripto estos prizorgita sed ne enhavas la kvanton de датаnoj kiel ale. 普斯图·雷维齐奥伊·博尔塔伊·罗曼梅(英語:Katlusega kuro loke backta sexon) 提亚尔·古滕贝格jn detalojn pri la sinume kajt somajn detalojn detalojn. <i>.: 1969.820 (英语).</i> ';

